void ReorganizeData(size_t len, unsigned short buffer[], unsigned char *even, unsigned char *odd)
{
	for (size_t i=0;i<len;i++)
	{
		even[i] = static_cast<unsigned char>(buffer[i]);
		odd[i]	= static_cast<unsigned char>(buffer[i]>>8);
	}
}

	typedef struct tagsDictionary
	{
		size_t Match;
		size_t Length;
		unsigned int NoOccurence;
	}sDictionary;

bool CreateDictionary(size_t len, unsigned short *buffer)
{
	const size_t MinRequiredDictLength=3;
	size_t CurrDirectoryIndex=0;
	sDictionary myDict[4096];
	memset(myDict,0,sizeof(myDict));
	for (size_t i=0;i<len;i++)
	{
		size_t bestmatchlen=0;
		for (size_t j=0;j<i;j++)
		{	
			size_t k=0;
			size_t currentmatchlen = 0;
			while (buffer[i+k]==buffer[j+k]&&(i+k<len))
			{
				currentmatchlen++;
				k++;
			}
			if (currentmatchlen>MinRequiredDictLength&&currentmatchlen>=bestmatchlen)
			{
				myDict[CurrDirectoryIndex].Match	= j;
				myDict[CurrDirectoryIndex].Length	= currentmatchlen;
				CurrDirectoryIndex++;
				bestmatchlen = currentmatchlen;
				i = i+k;
			}
		}
	}
	return true;
}

